Para a execução dos serviços devem ser observados alguns critérios técnicos, onde destacamos:

1 - Para o transporte adequado deverá ser feito com veículo fechado ou com suporte adequado para não afetar as mudas que estão em tubetes de 15 cm;

2 - Para perfuração do solo a orientação é que utilizem perfuradores de adequados, com brocas especificas para tubetes de 15 cm ou equipamento similar;

3 - As mudas serão plantadas nas áreas adjacentes ao lado da cerca existente da Estação de Tratamento de Esgoto - ETE;

4 - Deve ser considerado o alinhamento com a cerca existente o espaçamento será linear de 2x3 metros entre mudas das fileiras;

5 - O plantio deve seguir em 6 fileiras paralelas intercaladas seguindo por mil (1000) metros de comprimento de cada lado;

6 - Seguindo por quinhentos (500) metros de frente e quinhentos (500) metros de fundo intercaladas com espaçamento de 2x3 metros das fileiras para melhorar a contenção de odores oriundos do tratamento do esgoto;

7 - Na parte da frente onde fica a APP deverá ser feito o plantio de quinhentas (500) mudas nas proximidades da nascente;

8 - Na parte do fundo da ETE onde fica a nascente de água será feito o plantio com as mil e quinhentas (1500) mudas de espécies frutíferas com espaçamento de 1x1 metro;

9 - Para o plantio deve ser utilizado fertilizantes/adubos e inseticida para contenção de pragas específicas para que as mudas cresçam com padrão igual em conformidade umas com as outras, uma vez que as mudas estão em tubetes de 15 cm com pouco material orgânico; 

10 - Oito mil (8.000) mudas de eucalipto (nome comum) e Duas mil mudas (2.000) de frutíferas diversificadas;

11 - Para entrega final do plantio será necessário apresentar relatório de monitoramento com a contabilização das mudas perdidas no prazo de 12 meses após o plantio para que as perdas sejam reparadas com as mudas remanescentes.

